import ReactDOM from 'react-dom';

ReactDOM.render(
  <div>
  <h1>Hello World ...!!!</h1>
  <h2>Jataka ma tenuu baraa bhananaa aee...</h2>,
  <b>Hello Pakistan !!</b>
  </div>,
  document.getElementById("root")
);

